import React from 'react';
import "./App.scss";
import { Container, Section } from 'rbx';
import Header from "./components/header";
import Home from "./screens/home";
import Restaurants from "./screens/restaurants";

const App = () => (
  <div>
    <Header />
    <Section>
      <Container>
        <Home />
      </Container>
    </Section>
  </div>
)
export default App;
